:root {
  --color-info: #488BC8;
  --color-primary: #48BBC8;
  --color-error: #FF6162;
  --color-warning: #F2994A;
  --color-icon: #666666;
  --color-disabled: #D9D9D9;
  --color-success: #4EC09E;
  --color-secondary: #F3F8FD;
  --color-text: #000000;
  --color-darkenSecondary: #C7D8EC ;
}

.color-primary {
  color: #48BBC8;
}
.color-info {
  color: #488BC8;
}
.color-error {
  color: #FF6162;
}
.color-warning {
  color: #F2994A;
}
.color-icon {
  color: #666666;
}
.color-disabled {
  color: #D9D9D9;
}
.color-success {
  color: #4EC09E;
}
.color-secondary {
  color: #F3F8FD;
}
.color-text {
  color: #000000;
}
.color-darkenSecondary {
  color: #C7D8EC;
}

.custom-btn {
  background: #48bbc8;
  border-radius: 8px;
  width: 100%;
  max-width: 280px;
  height: 36px;
  border: none;
  outline: none;
  cursor: pointer;
  color: white;
}
.custom-btn:hover {
  box-shadow: 0px 0px 6px rgba(0, 0, 0, 0.14);
}

.textfield {
  display: flex;
  flex-direction: column;
  width: 100%;
}
.textfield__input {
  width: 100%;
  height: 36px;
  border-radius: 4px;
  border: 1px solid var(--color-disabled);
  background: #ffffff;
  box-sizing: border-box;
}
.textfield__input:focus-visible {
  outline: 2px solid var(--color-primary);
}
.textfield input {
  font-size: 16px;
}
.textfield input::placeholder {
  color: var(--color-disabled);
}
.textfield input[type=text], .textfield input[type=email], .textfield input[type=password] {
  padding-left: 10px;
}

body {
  font-family: "Source sans pro", sans-serif;
}

.mb-4 {
  margin-bottom: 16px;
}

.mb-2 {
  margin-bottom: 8px;
}

.mb-10 {
  margin-bottom: 40px;
}

.mb-16 {
  margin-bottom: 64px;
}

.mr-2 {
  margin-right: 8px;
}

.mr-4 {
  margin-right: 16px;
}

.text-title {
  font-style: normal;
  font-weight: normal;
  font-size: 20px;
  line-height: 20px;
}

.text-caption {
  font-size: 0.75rem;
  line-height: 1.25rem;
  color: #999999;
}

.elevation {
  box-shadow: 0px 0px 6px rgba(0, 0, 0, 0.14);
}

.bordered {
  border-radius: 16px;
}

.link {
  color: var(--color-info);
  cursor: pointer;
}

.error {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
}
.error__icon {
  width: 130px;
}
.error__text {
  font-size: 34px;
}
.error .link {
  font-size: 24px;
  font-weight: bold;
}

